import React, { useState, useEffect } from 'react';
import * as serverApi from '../helpers/server_api';

export default function UseGetMyCoursesEffect() {
    const placeHolderData = {
        admin: {
            approved: [{
                name: "React js full course",
                description: "Master React v16.6.3 and Redux with React Router, Webpack, and Create-React-App. Includes Hooks!",
                courseId: 'data:image/png;base64,'
            },
            {
                name: "React js full course",
                description: "Master React v16.6.3 and Redux with React Router, Webpack, and Create-React-App. Includes Hooks!",
                courseId: 'data:image/png;base64,'
            }],
            pending: []
        },
        participate: {
            approved: [{
                name: "React js full course",
                description: "Master React v16.6.3 and Redux with React Router, Webpack, and Create-React-App. Includes Hooks!",
                courseId: 'data:image/png;base64,'
            }],
            pending: [{
                name: "React js full course",
                description: "Master React v16.6.3 and Redux with React Router, Webpack, and Create-React-App. Includes Hooks!",
                courseId: 'data:image/png;base64,'
            }]
        }
    };

    const resultDefault = {
        admin: {
            approved: [],
            pending: []
        },
        participate: {
            approved: [],
            pending: []
        }
    };
    const [result, setResult] = useState(resultDefault);
    const [loading, setLoading] = useState(false);
  
    useEffect(() => {
        function fetchList() {
            setLoading(true);

            serverApi.get('courses/mine', {}, (data) => {
                setResult(placeHolderData);
                setLoading(null);
                // setResult(data[serverModule])
            });
        }

        fetchList();

    }, []);
  
    return [result, loading];
}

